void conv_ref::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"image_V_address0\" :  \"" << image_V_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"image_V_ce0\" :  \"" << image_V_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"image_V_q0\" :  \"" << image_V_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"weights_V_address0\" :  \"" << weights_V_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"weights_V_ce0\" :  \"" << weights_V_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"weights_V_q0\" :  \"" << weights_V_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"weights_V_address1\" :  \"" << weights_V_address1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"weights_V_ce1\" :  \"" << weights_V_ce1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"weights_V_q1\" :  \"" << weights_V_q1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_conv_V_address0\" :  \"" << output_conv_V_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_conv_V_ce0\" :  \"" << output_conv_V_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_conv_V_we0\" :  \"" << output_conv_V_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_conv_V_d0\" :  \"" << output_conv_V_d0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"output_conv_V_q0\" :  \"" << output_conv_V_q0.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

